import React from 'react';
import { ToastContainer } from 'react-toastify';
import './App.css';
import Navbar from './components/layout/Navbar';

const App = () => {
  return (
    <div className="App">
      <ToastContainer />
      <Navbar />

      <h1>Hello Word!</h1>
    </div>
  );
};

export default App;
